import { observable } from "mobx";
import moment from 'moment'

export type periodUnit = 'year' 
type verifiedProvider = 'provider-abc' | 'provider-pqr' | 'provider-xyz'

export class Domain {
  id: string;
  name: string;
  registeredDate: moment.Moment;
  period: {
    value: number,
    unit: periodUnit
  };
 contact: {
   provider: verifiedProvider,
   id: string
 };

  constructor(id: string = "", name: string = "", registerdDate: moment.Moment = moment(), period: any = {value: 1, unit: 'year'}, contact: any = {provider: 'provider-abc', id: ''}) {
    this.id = id;
    this.name = name;
    this.registeredDate = registerdDate;
    this.period = period;
    this.contact = contact
  }
}
